import Header from './Header'
import Head from 'next/head';

export const Layout = (props) => (
  <div>
    <Head>
      <link type="text/css" rel="stylesheets" href="http://themes.potenzaglobalsolutions.com/html/sam-martin/it/layout-2/css/bootstrap.min.css"></link>
    </Head>
    <Header />
    { props.children }
  </div>
);
